function findCommonNumbers(arr1, arr2, arr3) {
    // Get elements from the 2nd index onwards
    const filteredArr1 = arr1.slice(2);
    const filteredArr2 = arr2.slice(2);
    const filteredArr3 = arr3.slice(2);

    // Create a Set from the first array's filtered elements for quick lookup
    const set1 = new Set(filteredArr1);

    // Find common elements in arr2 and arr3 with the Set
    const commonWithArr2 = filteredArr2.filter(num => set1.has(num));
    const set2 = new Set(commonWithArr2);

    // Find common elements in arr3 with the Set of common elements from arr2
    const commonWithArr3 = filteredArr3.filter(num => set2.has(num));

    return commonWithArr3;
}

function generateCategory() {
    while (true) {
        let index = Math.floor(Math.random() * listoflists.length); // Primary Index
        if (listoflists[index].length == 1) continue
        listCategory = listoflists[index];
        firstCategory = listoflists[index][0];
        nextThree = []
        if (listCategory.length < 4) continue
        for (let x = 0; x < 3; x++) { // Gen the 3 Oppos
            mrGuy = 1 + Math.floor(Math.random() * (listCategory.length-1))
            if (listoflists[mrGuy].length == 1) {x--; continue}
            nextThree.push(listCategory[mrGuy])
            listCategory.splice(mrGuy, 1)
        }
        const arr1 = listoflists[nextThree[0]]
        const arr2 = listoflists[nextThree[1]]
        const arr3 = listoflists[nextThree[2]]
        yipperskis = findCommonNumbers(arr1, arr2, arr3)
        if (yipperskis.length < 2) continue
        category = []
        category.push(categories[firstCategory])
        for (let x = 0; x < 2; x++) { // Gen the remaining 2
            mrGuy = Math.floor(Math.random() * (yipperskis.length))
            category.push(categories[yipperskis[mrGuy]])
            //console.log("PREV " + yipperskis)
            yipperskis.splice(mrGuy, 1)
            //console.log(yipperskis)
        }
        category.push(categories[nextThree[0]])
        category.push(categories[nextThree[1]])
        category.push(categories[nextThree[2]])
        if (new Set(category).size !== category.length) {
            alert("DUPLICATE!!!!!!!!!!!!")
        }
        return category;
    }
}

const resultsBox = document.querySelector(".result-box");
const inputBox = document.getElementById("input-box");

inputBox.onkeyup = function() {
    let result = [];
    let input = inputBox.value;
    if (input.length>=3) {
        result = availableKeywords.filter((keyword) => {
            return keyword.toLowerCase().includes(input.toLowerCase());
        });
    }
    display(result);

    if(!result.length){
        resultsBox.innerHTML = '';
    }
}

function display(result) {
    const content = result.map((list) =>{
        return "<li onclick=selectInput(this)>" + list + "</li>";
    });

    resultsBox.innerHTML = "<ul>" + content.join('') + "</ul>";
}

function selectInput(list) {
    inputBox.value = list.innerHTML;
    resultsBox.innerHTML = '';
}

window.onload = function() {
    currentCategories = category;
    //currentCategories = ['SLACK-OFF', 'SLACK-OFF', 'SLACK-OFF', 'BLAZE', 'BLAZE', 'BLAZE'];
    row1.textContent = currentCategories[0];
    row1.style.fontSize = '40px';
    row1.style.align = 'center';
    row2.textContent = currentCategories[1];
    row2.style.fontSize = '40px';
    row2.style.align = 'center';
    row3.textContent = currentCategories[2];
    row3.style.fontSize = '40px';
    row3.style.align = 'center';
    col1.textContent = currentCategories[3];
    col2.textContent = currentCategories[4];
    col3.textContent = currentCategories[5];
    zoomIfNeeded();
    translatePage();
}

window.onresize = function() {
    if (window.innerWidth > 960) {
        container.style.transform = "translateX(" + (0) + "px)";
        zoomIfNeeded();
        translatePage();
    }
}

    let translater = 0;

function zoomIfNeeded() {
    var viewportWidth = window.innerWidth;
    var viewportHeight = window.innerHeight;

    if (viewportWidth < 1920 || viewportHeight < 1080) {6
        var scale = Math.max(1920 / viewportWidth, 1080 / viewportHeight);
        document.body.style.width = (scale * 100) + "%";
        document.body.style.transform = "scale(" + (1 / scale) + ")";
        document.body.style.transformOrigin = "top left";
    }
}

function translatePage() {
    var pixel = document.elementFromPoint(0, 0);
    var num = 0;
    var color = window.getComputedStyle(pixel).backgroundColor;
    while (color==='rgb(51, 51, 51)') {
        num++;
        var pixel = document.elementFromPoint(num, 0)
        var color = window.getComputedStyle(pixel).backgroundColor;
    }
    //container.style.transform = "translateX(" + (window.innerWidth - findRightmostHeaderPixel()) + "px)";
    var personamente = num;
    container.style.transform = "translateX(" + (window.innerWidth - personamente) + "px)";
    //container.style.transform = "translateX(" + ((window.innerWidth - personamente)/2) + "px)";
    translater = window.innerWidth-personamente;
    var pixel = document.elementFromPoint(0, 0);
    var num = 0;
    var color = window.getComputedStyle(pixel).backgroundColor;
    while (!(color==='rgb(51, 51, 51)')) {
        num++;
        var pixel = document.elementFromPoint(num, 0)
        var color = window.getComputedStyle(pixel).backgroundColor;
    }    
    var bigPoopa = num;
    while (color==='rgb(51, 51, 51)') {
        num++;
        var pixel = document.elementFromPoint(num, 0)
        var color = window.getComputedStyle(pixel).backgroundColor;
    }
    num--;    
    var theBigSmellaFella = (bigPoopa + num) / 2;    
    container.style.transform = "translateX(" + (0) + "px)";
    container.style.transform = "translateX(" + ((window.innerWidth / 2) - theBigSmellaFella + translater) + "px)";
    translater = (window.innerWidth / 2) - theBigSmellaFella + translater;
}

function findRightmostHeaderPixel() {
    // Get the header element
    var header = document.querySelector('.header');

    // Get the width of the header
    var headerWidth = header.offsetWidth;

    // Get the left offset position of the header
    var headerLeft = header.offsetLeft;

    // Calculate the rightmost pixel position
    var rightmostPixel = headerLeft + headerWidth;

    return rightmostPixel;
}
